style.css:
/* Change background color */
body {
    background-color: #f0f8ff; /* Light blue */
}

/* Change text color */
body, h1, p {
    color: #333; /* Dark gray */
}

/* Change button color */
button {
    background-color: #4682b4; /* Steel blue */
    color: #fff; /* White */
}

/* Change links color */
a {
    color: #4169e1; /* Royal blue */
}
